import React, { useState } from 'react';
import Profile from './Profile';
import FeePayment from './FeePayment';
import Attendance from './Attendance';
import Results from './Results';
import Courses from './Courses';
import Placements from './Placements';
import ExamTimeTable from './ExamTimeTable';
import AdmitCard from './AdmitCard';
import Grievances from './Grievances';
import TimeTable from './TimeTable';

function Dashboard({ onLogout }) {
  const [activeTab, setActiveTab] = useState('home');

  const announcements = [
    { id: 1, title: "Techno Cultural Fest", content: "Get ready for Spectrum 2024!", date: "2024-02-15" },
    { id: 2, title: "Mid-Sem Exams", content: "Start preparing for exams in 12 days.", date: "2024-02-20" },
    { id: 3, title: "AI & ML Workshop", content: "Industry experts from Google!", date: "2024-02-25" },
    { id: 4, title: "Sports Day", content: "Register now for the Annual Sports Meet.", date: "2024-03-01" },
    { id: 5, title: "Placement Drive", content: "Top tech companies visiting soon!", date: "2024-03-10" },
  ];

  const currentDate = new Date();

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-gray-200 text-black p-5 flex flex-col overflow-y-auto">
        {[
          { tab: 'home', label: 'Home' },
          { tab: 'profile', label: 'Profile' },
          { tab: 'attendance', label: 'Attendance' },
          { tab: 'results', label: 'Results' },
          { tab: 'timetable', label: 'Time Table' },
          { tab: 'calendar', label: 'Calendar of Events' },
          { tab: 'courses', label: 'Courses' },
          { tab: 'examtimetable', label: 'Exam Time Table' },
          { tab: 'admitcard', label: 'Admit Card' },
          { tab: 'placements', label: 'Placements' },
          { tab: 'grievances', label: 'Grievances' },
          { tab: 'feepayment', label: 'Fee Payment' },
        ].map(({ tab, label }) => (
          <button
            key={tab}
            className={`py-2 px-4 rounded-lg mb-2 ${
              activeTab === tab ? 'bg-blue-600 text-white' : 'hover:bg-blue-300'
            }`}
            onClick={() => setActiveTab(tab)}
          >
            {label}
          </button>
        ))}
        <button className="mt-auto py-2 px-4 bg-gray-300 hover:bg-gray-400 rounded-lg" onClick={onLogout}>
          Logout
        </button>
      </div>

      {/* Main Content */}
      <div className="flex-grow p-5 overflow-y-auto bg-white shadow-lg">
        {activeTab === 'home' && (
          <div className="p-5 rounded-lg">
            <h1 className="text-2xl font-bold mb-4">Welcome to the Dashboard</h1>
            <div className="announcements">
              <h2 className="text-xl font-semibold mb-3">Announcements</h2>
              <ul>
                {announcements.map(announcement => (
                  <li key={announcement.id} className="mb-3">
                    <h3 className="font-bold">{announcement.title}</h3>
                    <p>{announcement.content}</p>
                    <span className="text-gray-500 text-sm">{announcement.date}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        )}

        {activeTab === 'profile' && (
          <div className="h-full">
            <Profile />
          </div>
        )}
        {activeTab === 'attendance' && <Attendance />}
        {activeTab === 'results' && <Results />}
        {activeTab === 'timetable' && <TimeTable />}
        {activeTab === 'calendar' && <div>Calendar will go here</div>}
        {activeTab === 'courses' && <Courses />}
        {activeTab === 'placements' && <Placements />}
        {activeTab === 'examtimetable' && <ExamTimeTable />}
        {activeTab === 'admitcard' && <AdmitCard />}
        {activeTab === 'grievances' && <Grievances />}
        {activeTab === 'feepayment' && <FeePayment />}
      </div>
    </div>
  );
}

export default Dashboard;
